data.text:
@ladyMariaDust Lo dice Varok en "una guerra justa": sacrificaria Orgrimmar en una batalla suicida para preservar el honor.
El trabajo de Sylvanas es impedir que eso pase.
Con el mak'gora se evita justo eso, el derramamiento de más sangre de la Horda.

@canete707 @nelarolan Exceptuando en el hipócrita y suicida mundo occidental, cualquier pájaro que intenta destruir una nación (la suya propia en este caso) es pasado por las armas.
El haber cometido sus delitos aquí les ha salvado la vida.
Algún día agradecerán ser lo que son: españoles. https://t.co/Zh7yZWYdel

@el_tope_suicida ごくたまに止まることがあります。

ごくたまになので
普段は快適に見ることが出来ます！

